import H1BAlternative from '../Components/h1balternative';
import TouristVisa from '../Components/Touristvisa';
import VisaRefusal from '../Components/visarefusal';


const Visa = ()=>{
    return (
        <div className='visapage'>
        <Header></Header>
        <Navbar></Navbar>
        <div className='visastd'>  <StudyAbroad></StudyAbroad></div>
           <h2 className='visamainhead'>VISA SERVICES</h2>
       <div className='visafirstdiv'> <BusinessVisa ></BusinessVisa ><DependentVisa></DependentVisa><EB5Visa></EB5Visa><H1BAlternative></H1BAlternative><TouristVisa/><VisaRefusal/> */}
         </div> 
          
       <div className='yoursnextstepdiv' > <YourNextStep></YourNextStep></div>
      <Footer></Footer>
     </div>
    )
    }
   
    export default Visa;
